import React from 'react'
import {Link} from 'react-router-dom'

const VendingMachine = () => {
    return(
    <>
        <h1>Vending Machine</h1>
        <p>< Link to='/drink'>Go to drinks page</Link></p> 
        <p>< Link to='/drink'>Go to drinks page</Link></p> 
        <p>< Link to='/drink'>Go to drinks page</Link></p> 
    </>
    )
}

export default VendingMachine;
